"Affiliations": ["School of Chemical and Biomolecular Engineering, Georgia Institute of Technology", "School of Metallurgy, Northeastern University", "School of Chemical Engineering and Technology, Tianjin University", "College of Energy and Institute for Electrochemical Energy Storage, Nanjing Tech University"],
"Methods": [
    {
        "name": "Synthesis of GO powders",
        "description": "Modified Hummer method is used to produce aqueous GO solution. The pretreated powder is placed in a beaker containing 120 ml concentrated H2SO4 solution. Under stirring in ice bath, 15 g KMnO4 is added into the beaker. The mixture is then heated to 98 /C176C and maintained at 98 /C176C for 15 min. The resulting suspension is then subject to a 2 h sonication, followed by a 15-min centrifugation at 4000 rpm. The transparent supernatant is obtained as the GO aqueous solution."
    },
    {
        "name": "Fabrication of GO-coated Zn anodes",
        "description": "GO/water binder slurry is prepared by mixing 2.1 mg GO powder, 2.4 mg water binder, and 160 lL water in a glass vial under sonication for 60 min. The slurry is then stirred for 1 day at room temperature. Zn mesh is cut into round disks with 1 cm diameter using a precision disc cutter and then weighed. The GO slurry is applied onto the surface of the Zn mesh disks and dried for 20 min. The GO-modified Zn mesh is dried at room temperature in air."
    },
    {
        "name": "Preparation of Ni cathodes",
        "description": "Ni cathodes harvested from commercial Ni-Zn AA batteries are used as the rechargeable cathode. Before cell assembly, Ni cathodes are electrochemically oxidized to 0.6 V vs HgO/Hg reference electrode in a beaker cell with 2 M KOH as the electrolyte, to completely turn Ni(OH)2 to NiOOH."
    },
    {
        "name": "Assembly of coin-type rechargeable Zn-Ni batteries",
        "description": "The coin-type batteries are assembled using CR2032 cases, the Zn mesh anodes or Zn@GO anodes and NiOOH cathodes with excess capacity. Glass fiber is used as the separator. 50 lL electrolyte is added onto each separator. The aqueous electrolyte consists of 4 M KOH, 2 M KF and 2 M K2CO3. An MSK-110 M hydraulic sealing machine is used to seal the battery."
    }
]
